import {React, useEffect, useCallback, useState} from "react";
import axios from "axios";
import {getToken} from "../utils/Common";

const UserList=()=>{

    const[users,setUsers]=useState([]);
    const[requestError,setRequestError]=useState();

    const token= getToken();
 
    axios.interceptors.request.use(
        config =>{
            config.headers.authorization= `Bearer ${token}`;
            return config;
        },
        error=>{
            return Promise.reject(error);
        }
    )

    // useEffect(()=>{
    //         useCallback(async(()=>{
    //             try{
    //                 const result= await axios.get('https://10.100.17.47/FairEx/api/v1/admin/userList');   
    //                 setUsers(result.data)
    //             }
    //             catch(err){
    //                 setRequestError(err.message);
    //             }
    //         }))
    // })

    const fetchData = useCallback(async()=>{
        try{
            const result= await axios.get('https://10.100.17.47/FairEx/api/v1/admin/userList');
            setUsers(result.data);
        }catch(e){
            setRequestError(e.message);
        }
    })

    // useEffect(()=>{
    //     fetch('https://10.100.17.47/FairEx/api/v1/admin/userList',
    //     {
    //         method: 'GET',
    //         headers: {
    //             'Content-Type': 'application/json'
    //         }
    //     })
    //     .then((response)=>{setUsers(response.data)})
    // }  )
    

    return(
        <div className="textheader">
            Available Users:
            <br/>
            <select>
                <option disable selected onClick={()=>fetchData()}>---Select---</option>
                {/* {
                    users.map((user)=>{
                        return( 
                            <option title={user.id}>{user.name}</option>
                        )
                    })
                    
                }  */}
            </select>
        </div>

    )
}
export default UserList;
